import React from 'react';
import {BrowserRouter as Router, Route} from "react-router-dom";
import Header from './partials/Header';
import Footer from './partials/Footer';
import Index from './pages/Index';
import About from './pages/About';
import Compute from './pages/Compute';
import OpenStorage from './pages/OpenStorage';
import OpenDB from './pages/OpenDB';
import StaticApps from './pages/StaticApps';
import OpenAuth from './pages/OpenAuth';
import OpenPay from './pages/OpenPay';
import Workspaces from './pages/Workspaces';
import AddWorkspaces from './pages/AddWorkspace';
import Extensions from './pages/Extensions';
import Domains from './pages/Domains';
import Access from './pages/Access';
import Profile from './pages/Profile';
import Billing from './pages/Billing';
import Settings from './pages/Settings';
import Loading from './partials/Loading';


function App() {
    return (
      <Router>
        <Loading/>
        <Header/>
        <Route path="/" exact component={Index}/>
        <Route path="/about" exact component={About}/>
        <Route path="/computeapp" exact component={Compute}/>
        <Route path="/openstorage" exact component={OpenStorage}/>
        <Route path="/opendb" exact component={OpenDB}/>
        <Route path="/staticapps" exact component={StaticApps}/>
        <Route path="/openauth" exact component={OpenAuth}/>
        <Route path="/openpayments" exact component={OpenPay}/>
        <Route path="/workspaces" exact component={Workspaces}/>
        <Route path="/addworkspaces" exact component={AddWorkspaces}/>
        <Route path="/extensions" exact component={Extensions}/>
        <Route path="/domains" exact component={Domains}/>
        <Route path="/accesscontrol" exact component={Access}/>
        <Route path="/profile" exact component={Profile}/>
        <Route path="/billing" exact component={Billing}/>
        <Route path="/settings" exact component={Settings}/>
        <Footer/>
      </Router>
    )
}

export default App
